(1, 1, '2019-11-06 10:53:15', '2019-11-06 07:53:15', '<!-- wp:paragraph -->\n<p>Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите ее, затем начинайте создавать!</p>\n<!-- /wp:paragraph -->', 'Привет, мир!', '', 'publish', 'open', 'open', '', '%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80', '', '', '2019-11-06 10:53:15', '2019-11-06 07:53:15', '', 0, 'http://rendhauspro:8888/?p=1', 1, 'post', '', 1),
